package com.example.userschool.model;public class StudentMark {    private int studentID;    private int practical;    private int thearitical;    public StudentMark(int studentID, int practical, int thearitical) {        this.studentID = studentID;        this.practical = practical;        this.thearitical = thearitical;    }    public StudentMark() {    }    public int getStudentID() {        return studentID;    }    public void setStudentID(int studentID) {        this.studentID = studentID;    }    public int getPractical() {        return practical;    }    public void setPractical(int practical) {        this.practical = practical;    }    public int getThearitical() {        return thearitical;    }    public void setThearitical(int thearitical) {        this.thearitical = thearitical;    }}